import React, { Component } from 'react';
import {connect} from 'react-redux';
import {getUser} from './../../reducers/user.reducer';
import {signin} from './../../actions/user.actions';
import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';
import Typography from '@material-ui/core/Typography';

class LoginPage extends Component {
  constructor(props){
    super(props)
    this.state={
      username: '',
      password: '',
    }
    this.handleChangeUser=this.handleChangeUser.bind(this);
    this.handleChangePassword=this.handleChangePassword.bind(this);
    this.submit=this.submit.bind(this);
    this.goHome=this.goHome.bind(this);
    this.handleKeyPress=this.handleKeyPress.bind(this);
  }

  handleChangeUser(e){
    this.setState({username:e.target.value});
  }

  handleChangePassword(e){
    this.setState({password:e.target.value});
  }

  submit(){
    this.props.dispatch(signin(this.state.username,this.state.password));
  }

  handleKeyPress(e){
    if(e.key === 'Enter'){
      this.submit();
    }
  }

  goHome(){
    this.props.history.push(`/source/${this.state.username}/`);
  }

  render() {
    return (
      <div className="LoginPage">
        <Typography variant="display3">Login</Typography>
        <div className="Form">
          <TextField
            id="email-input"
            label="Username / Email"
            value={this.state.email}
            onChange={this.handleChangeUser}
            onKeyPress={(e)=>{this.handleKeyPress(e)}}
            margin="normal"
          />
          <TextField
            id="password-input"
            label="Password"
            type="password"
            value={this.state.password}
            onChange={this.handleChangePassword}
            onKeyPress={(e)=>{this.handleKeyPress(e)}}
            margin="normal"
          />
          <Button variant="raised" color="primary" onClick={this.submit} className="SubmitButton" >Submit</Button>
        </div>
      </div>
    );
  }
}

const mapStateToProps =(state)=>{
  return {
    user: getUser(state)
  }
}
export default connect(mapStateToProps)(LoginPage);
